import React from 'react';
import { Header } from '../src/Header';
import { Menu } from '../src/Menu';
import OpenCampaign from './OpenCampaign';
function Home({ campaigns, setCampaigns }) {
  return (
    <div>
      <Header />
      <Menu />

      <div className="container">
        <div className="row">
          <div className="col-12">
            <h2>Home</h2>
          </div>
        </div>
        <div className="row">
          <div className="col-6">
            <OpenCampaign setCampaigns={setCampaigns} />
          </div>
          <div className="col-6">
            <h1>Campaigns List</h1>
            <ul>
              {campaigns.map(({ name }) => {
                return <li>{name}</li>;
              })}
            </ul>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
